import config from "~/config";
import React from "react";
const Product = React.lazy(() => import("~/pages/Product/Product"));
const Home = React.lazy(() => import("~/pages/Home/Home"));
const PrivateRoute = React.lazy(() => import("~/pages/PrivateRoute"));
const ProductList = React.lazy(() => import("~/pages/ProductList"));
const Products = React.lazy(() => import("~/pages/Products"));
const ProductTypeDetail = React.lazy(() => import("~/pages/ProductTypeDetail"));

const publicRoutes = [
  { path: config.routes.home, component: Home },
  {
    path: config.routes.product,
    component: Product,
  },
  {
    path: config.routes.private,
    component: PrivateRoute,
    private: [
      {
        path: config.routes.admin,
        component: ProductList,
      },
      {
        path: config.routes.producttypes,
        component: Products,
      },
      {
        path: config.routes.detailtype,
        component: ProductTypeDetail,
      },
      {
        path: config.routes.addtypeproduct,
        component: ProductTypeDetail,
      },
      {
        path: config.routes.addproduct,
        component: ProductTypeDetail,
      },
      {
        path: config.routes.products,
        component: ProductTypeDetail,
      },
    ],
  },
];

const privateRoutes = [];

export { publicRoutes, privateRoutes };
